import React, { Component } from "react";
import { connect } from "react-redux";
import { Button, Header, Icon, Image, Modal } from "semantic-ui-react";

export class EditProduct_Modal extends Component {
    state={
        ModalEdit:false
    }
  render() {
    return (
      <>
        <Modal trigger={this.props.ModalEdit}>
          <Modal.Header>Profile Picture</Modal.Header>
          <Modal.Content image scrolling>
            <Image size="medium" src="/images/wireframe/image.png" wrapped />

            <Modal.Description>
              <Header>Modal Header</Header>
              <p>
                This is an example of expanded content that will cause the
                modal's dimmer to scroll
              </p>


            </Modal.Description>
          </Modal.Content>
          <Modal.Actions>
            <Button primary>
              Proceed <Icon name="chevron right" />
            </Button>
          </Modal.Actions>
        </Modal>
      </>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(EditProduct_Modal);
